import React from "react";
import Layout from "../Layout";
import "./Contact.css";
const Contact = () => {
  return (
    <Layout>
      <div className="Contact">
        <h1 className="SectionHeader contact">Contact Me</h1>
        <div className="ContactArea"></div>
      </div>
    </Layout>
  );
};

export default Contact;
